.pastAppointments','SELECT\r\n     app_service.name                                                                                AS `DASHBOARD_APPOINTMENTS_SERVICE_KEY`,\r\n     app_service_type.name                                                                           AS `DASHBOARD_APPOINTMENTS_SERVICE_TYPE_KEY`,\r\n     DATE_FORMAT(start_date_time, \"%d/%m/%Y\")                                                        AS `DASHBOARD_APPOINTMENTS_DATE_KEY`,\r\n     CONCAT(DATE_FORMAT(start_date_time, \"%l:%i %p\"), \" - \", DATE_FORMAT(end_date_time, \"%l:%i %p\")) AS `DASHBOARD_APPOINTMENTS_SLOT_KEY`,\r\n     prov.name                                                                                       AS `DASHBOARD_APPOINTMENTS_PROVIDER_KEY`,\r\n     pa.status                                                                                       AS `DASHBOARD_APPOINTMENTS_STATUS_KEY`\r\nFROM\r\n   patient_appointment pa\r\n   JOIN person p ON p.person_id = pa.patient_id AND pa.voided IS FALSE\r\n   JOIN appointment_service app_service\r\n     ON app_service.appointment_service_id = pa.appointment_service_id AND app_service.voided IS FALSE\r\n   LEFT JOIN provider prov ON prov.provider_id = pa.provider_id\r\n   LEFT JOIN appointment_service_type app_service_type\r\n     ON app_service_type.appointment_service_type_id = pa.appointment_service_type_id\r\n WHERE p.uuid = ${patientUuid} AND start_date_time < CURDATE() AND (app_service_type.voided IS FALSE OR app_service_type.voided IS NULL)\r\n ORDER BY start_date_time DESC\r\n LIMIT 5;','Past appointments for patient','89e0797a-a128-11e7-b307-0800272020f4',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.sqlGet.upComingAppointments','SELECT\r\n  app_service.name                                                                                AS `DASHBOARD_APPOINTMENTS_SERVICE_KEY`,\r\n  app_service_type.name                                                                           AS `DASHBOARD_APPOINTMENTS_SERVICE_TYPE_KEY`,\r\n  DATE_FORMAT(start_date_time, \"%d/%m/%Y\")                                                        AS `DASHBOARD_APPOINTMENTS_DATE_KEY`,\r\n  CONCAT(DATE_FORMAT(start_date_time, \"%l:%i %p\"), \" - \", DATE_FORMAT(end_date_time, \"%l:%i %p\")) AS `DASHBOARD_APPOINTMENTS_SLOT_KEY`,\r\n  prov.name                                                                                       AS `DASHBOARD_APPOINTMENTS_PROVIDER_KEY`,\r\n  pa.status                                                                                       AS `DASHBOARD_APPOINTMENTS_STATUS_KEY`\r\nFROM\r\n  patient_appointment pa\r\n  JOIN person p ON p.person_id = pa.patient_id AND pa.voided IS FALSE\r\n  JOIN appointment_service app_service\r\n    ON app_service.appointment_service_id = pa.appointment_service_id AND app_service.voided IS FALSE\r\n  LEFT JOIN provider prov ON prov.provider_id = pa.provider_id\r\n  LEFT JOIN appointment_service_type app_service_type\r\n    ON app_service_type.appointment_service_type_id = pa.appointment_service_type_id\r\nWHERE p.uuid = ${patientUuid} AND\r\n      start_date_time >= CURDATE() AND\r\n      (app_service_type.voided IS FALSE OR app_service_type.voided IS NULL)\r\nORDER BY start_date_time ASC;','Upcoming appointments for patient','89e10cbe-a128-11e7-b307-0800272020f4',NULL,NULL,NULL,NULL,NULL,NULL),('bahmnicore.mandatory','false','true/false whether or not the bahmnicore module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','873189b1-972a-4244-8084-85d98207bbcd',NULL,NULL,NULL,NULL,NULL,NULL),('bahmnicore.started','true','DO NOT MODIFY. true/false whether or not the bahmnicore module has been started.  This is used to make sure modules that were running  prior to a restart are started again','2293b5a8-b235-412f-9857-73203eb671a4',NULL,NULL,NULL,NULL,NULL,NULL),('bedmanagement.mandatory','false','true/false whether or not the bedmanagement module MUST start when openm